		get_frames: {
			title: "Get Frames",
      description: "Get <span class='provider'>frames</span> from " \
			"<span class='provider'>EDGAR</span>",
			help: lambda do |_input, _picklist_label|
			"This action retrieves all aggregated company facts for a specified taxonomy and tag in the specified calendar period."
			end,
			input_fields: lambda do |_object_definitions, _connection, _config_fields|
				[
					{ name: 'taxonomy', label: 'Taxonomy', optional: false, hint: 'Reporting taxonomy (e.g. us-gaap, ifrs-full, dei, srt).' },
					{ name: 'tag', label: 'Tag', optional: false, hint: 'Reporting tag (e.g. AccountsPayableCurrent).' },
					{ name: 'unit', label: 'Unit', optional: false, hint: 'Unit of measure specified in the XBRL (e.g. USD).' },
					{ name: 'calendar_period', label: 'Calendar Period', optional: false, hint: 'Calendar period (e.g. 2023 or 2023Q4)' },
					{ name: 'data_type', label: 'Data Type', optional: true, default: 'I', hint: 'I for instantaneous; A for annual; Q for quarterly. Defaults to I.' }
				]
			end,
			execute: lambda do |_connection, input, _extended_input_schema, _extended_output_schema, _continue|
			get("https://data.sec.gov/api/xbrl/frames/#{input['taxonomy']}/#{input['tag']}/#{input['unit']}/CY#{input['calendar_period']}#{input['data_type']}.json")
				.after_error_response(/.*/) do |_code, body, _header, message|
				error(message + ":" + body)
			end
			end,
			output_fields: lambda do |_object_definitions, _connection, _config_fields|
				[
					{ name: 'taxonomy', label: 'Taxonomy' },
					{ name: 'tag', label: 'Tag' },
					{ name: 'ccp', label: 'Calendar Period' },
					{ name: 'uom', label: 'Unit of Measure' },
					{ name: 'label', label: 'Label' },
					{ name: 'description', label: 'Description' },
					{ name: 'pts', label: 'Points' },
					{
					name: 'data',
					type: 'array',
					of: 'object',
					properties: [
						{ name: 'accn', label: 'Accession Number' },
						{ name: 'cik', label: 'CIK' },
						{ name: 'entityName', label: 'Entity Name' },
						{ name: 'loc', label: 'Location' },
						{ name: 'end', label: 'End Date', type: 'date' },
						{ name: 'val', label: 'Value', type: 'number' }
					]
					}
				]
			end
		},
	},

	triggers: {
		new_item_in_feed: {
			title: 'New entry',
			subtitle: 'New entry in SEC EDGAR Database',
			description: "New <span class='provider'>entry</span> in " \
			"<span class='provider'>EDGAR</span>",
			help: 'Checks for new events every 5 minutes. To build a ' \
				'customized feed schema, provide the feed URL and run a test job. Then, copy the ' \
				'JSON data from the action output and paste it in this action\'s Response Body settings.',
	
			input_fields: lambda do |object_definitions|
			object_definitions['new_item_input']
			end,
	
			poll: lambda do |connection, input, _page|
			xml = get(input['feed_url']).response_format_xml
			xml = xml&.dig('feed', 0).presence || xml&.dig('rss', 0, 'channel', 0)
	
			item_fields = if input['feed_list_name'].present?
							input['feed_list_name']
							else
							'entry'
							end
			items = call('format_api_output_field_names',
						call('parse_xml_to_hash',
								'xml' => xml,
								'array_fields' => [item_fields])&.compact&.[](item_fields))
	
			{ events: items || [], next_page: nil }
			end,
	
			dedup: lambda do |item|
			item.dig('content-type', 'accession-number') || item['accesion-number'] || item['id'] || Time.now.to_f
			end,
	
			output_fields: ->(object_definitions) { object_definitions['item'] },
	
			sample_output: lambda do |connection, input|
			xml = get(input['feed_url']).response_format_xml
			xml = xml&.dig('feed', 0).presence || xml&.dig('rss', 0, 'channel', 0)
			item_fields = if input['feed_list_name'].present?
							[input['feed_list_name']]
							else
							['entry']
							end
	
			call('format_api_output_field_names',
				call('parse_xml_to_hash',
						'xml' => xml,
						'array_fields' => item_fields)&.dig(item_fields[0], 0)) || {}
			end
		}
	}
}